import React from 'react';

const ImageList = props => {
    // console.log(props.images);
    const images = props.images.map(({desciption, id, urls}) => {
        return (
        <img 
            key={id}
            src = {urls.regular}
            alt =  {desciption} 
        />);
    });
    return <div>{images}</div>;
}

export default ImageList;
